svg.script:
var h_element;
var hSVGDoc;
var hSVGRoot;

var scale = 0.65;
var timerHID = null;
var timerHRunning = false;
var showH = true;

function stopHclock(){
    if(timerHRunning)
    clearInterval(timerHID)
    timerHRunning = false
}

function startHclock(){
    // Make sure the clock is stopped
    stopHclock()
    timerHID = setInterval("showSelectedH()",1000)
    timerHRunning = true
}

function showSelectedH(){
	if(showH == true){
		var paramArray = [];
        	if ( document.defaultView.frameElement ) {
			var params = document.defaultView.frameElement.getElementsByTagName("param");

           		for ( var i = 0, iLen = params.length; iLen > i; i++ ) {
				var eachParam = params[ i ];
				var name = eachParam.getAttribute( "name" );
				var value = eachParam.getAttribute( "value" );

				if(value == "selected"){
					setActive(name);
				}
			}
		}
	}
}

function SetHParams() {
	startHclock();
}

function __$(id){
	return document.getElementById(id);
}

function __$__(id){
	return document.defaultView.parent.document.getElementById(id);
}

function setActive(id){
	var controls = ["t1", "t2", "t3", "t4", "t5", "t6", "t7", "t8", "t9", "t10", "t11", "t12"];

	for(var i = 0; i < controls.length; i++){
		if(__$(controls[i])){
			__$(controls[i]).style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill:  #ffffff;";
		}
		if(__$__("e" + controls[i])) {
			__$__("e" + controls[i]).value = "";
		}
	}

	if(__$(id)){
		__$(id).style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill:  #9cdcf1;";
	}

	tstCurrentSelectedHour = id.substring(1);

	if(__$__("e" +id))  {
		__$__("e" + id).value = "selected";		
	}
}

function RunHourScript(LoadEvent) {
	var time = (new Date()).getHours();
	var range = "";

	if(time > 12){
		time = time - 12;
	}

	setActive("t" + time);

	/*top.SVGsetDimension	= setHDimension;
	top.SVGsetScale		= setHScale;*/
	hSVGDoc			= LoadEvent.target.ownerDocument;
	h_element		= hSVGDoc.getElementById("layerHour");

	setHDimension(566.72*scale,566.72*scale);
         setHScale(scale,scale);
}

function setHDimension(w,h) {
	hSVGDoc.documentElement.setAttribute("width", w);
	hSVGDoc.documentElement.setAttribute("height", h);
}

function setHScale(sw, sh) {
	h_element.setAttribute("transform", "scale(" + sw + " " + sh +")");
}
